import React from "react";
import ConfigFooter from '../capas/footer/footer';
import ConfigHeadContacto from '../capas/head/head';
import  Cv from '../componentes/cv.png';
import  Cvingles from '../componentes/cvingles.png';
import './cv.css'






const Curriculum = () => {
    return(
    <>
        <ConfigHeadContacto/>
        <div className="curriculums">
        <div >
            <div>
                <h3 >Proyecto Front </h3>
                </div> 
                 <img className="cvs1" src={Cv} alt="projecto"></img>
                </div> 
                <div >
            <div >
                <h3 >Proyecto Front </h3>
                </div> 
                 <img className="cvs2" src={Cvingles} alt="projecto"></img>
                </div> 

            </div>
        <ConfigFooter/>
    </>
    )
};

export default Curriculum;
